import React, { Component } from "react";
import Joyride from "react-joyride";

class JoyrideExport extends Component {
  state = {
    steps: [
      {
        target: ".my-1-step",
        content: "Let`s toogethere joyride Star Wars World!",
      },
      {
        target: ".my-2-step",
        content: "Everyone's learning Joyride!",
      },
      {
        target: ".my-3-step",
        content: "Everyone's learning Joyride!",
      },


    ],
  };
  render() {
    const { steps } = this.state;
    return (
      <div className="App">


        <Joyride steps={steps} />

        <header className="App-header ">

          <a className="App-link my-1-step" href="https://github.com/gilbarbara/react-joyride"
            target="_blank" rel="noopener noreferrer">Star Wars API joyride</a>






        </header>



      </div>

    );
  }
}

export default JoyrideExport;
